function addCSS(css) {
    var styleElement = document.createElement('style');
    styleElement.innerHTML = css;
    document.body.appendChild(styleElement);
}

function toggleCategory()
{
    var b = this.getAttribute("alt");
   	var e = document.getElementById("f_" + b);
   	var d = document.getElementById("f_" + b + "_div");
   	var c = parseInt(e.value);
  	if (c) {
        e.value = 0;
        d.className = "ic ic-" + b + "_d";
    } else {
        e.value = 1;
        d.className = "ic ic-" + b;
    }
}

